                           <p class="text-base sm:text-lg leading-relaxed break-words">var spdxExpressionParse = require('spdx-expression-parse');<br/><br/>var MIT_LICENSE = /ermission is hereby granted, free of charge, to any/;<br/>var BSD_LICENSE = /edistribution and use in source and binary forms, with or withou/;<br/>var BSD_SOURCE_CODE_LICENSE = /edistribution and use of this software in source and binary forms, with or withou/;<br/>var WTFPL_LICENSE = /DO WHAT THE FUCK YOU WANT TO PUBLIC LICENSE/;<br/>var ISC_LICENSE = /The ISC License/;<br/>var MIT = /\bMIT\b/;<br/>var BSD = /\bBSD\b/;<br/>var ISC = /\bISC\b/;<br/>var GPL = /\bGNU GENERAL PUBLIC LICENSE\s<em>Version ([^,]</em>)/i;<br/>var LGPL = /(?:LESSER|LIBRARY) GENERAL PUBLIC LICENSE\s<em>Version ([^,]</em>)/i;<br/>var APACHE = /\bApache License\b/;<br/>var WTFPL = /\bWTFPL\b/;<br/>// https://creativecommons.org/publicdomain/zero/1.0/<br/>var CC0_1_0 = /The\s+person\s+who\s+associated\s+a\s+work\s+with\s+this\s+deed\s+has\s+dedicated\s+the\s+work\s+to\s+the\s+public\s+domain\s+by\s+waiving\s+all\s+of\s+his\s+or\s+her\s+rights\s+to\s+the\s+work\s+worldwide\s+under\s+copyright\s+law,\s+including\s+all\s+related\s+and\s+neighboring\s+rights,\s+to\s+the\s+extent\s+allowed\s+by\s+law.\s+You\s+can\s+copy,\s+modify,\s+distribute\s+and\s+perform\s+the\s+work,\s+even\s+for\s+commercial\s+purposes,\s+all\s+without\s+asking\s+permission./i; // jshint ignore:line<br/>var PUBLIC_DOMAIN = /[Pp]ublic [Dd]omain/;<br/>var IS_URL = /(https?:\/\/[-a-zA-Z0-9\/.]<em>)/;<br/>var IS_FILE_REFERENCE = /SEE LICENSE IN (.</em>)/i;<br/><br/><br/>module.exports = function(str) &lbrace;<br/>    var match, version;<br/>    try &lbrace;<br/>        spdxExpressionParse(str || '');<br/>        return str;<br/>    &rbrace; catch (error) &lbrace;<br/>        // nothing<br/>    &rbrace;<br/>    if (str) &lbrace;<br/>        str = str.replace('\n', '');<br/>    &rbrace;<br/>    if (typeof str === 'undefined' || !str) &lbrace;<br/>        return 'Undefined';<br/>    &rbrace; else if (ISC_LICENSE.test(str)) &lbrace;<br/>        return 'ISC<em>';<br/>    &rbrace; else if (MIT_LICENSE.test(str)) &lbrace;<br/>        return 'MIT</em>';<br/>    &rbrace; else if (BSD_LICENSE.test(str)) &lbrace;<br/>        return 'BSD<em>';<br/>    &rbrace; else if (BSD_SOURCE_CODE_LICENSE.test(str)) &lbrace;<br/>        // https://spdx.org/licenses/BSD-Source-Code.html<br/>        return 'BSD-Source-Code</em>';<br/>    &rbrace; else if (WTFPL_LICENSE.test(str)) &lbrace;<br/>        return 'WTFPL<em>';<br/>    &rbrace; else if (ISC.test(str)) &lbrace;<br/>        return 'ISC</em>';<br/>    &rbrace; else if (MIT.test(str)) &lbrace;<br/>        return 'MIT<em>';<br/>    &rbrace; else if (BSD.test(str)) &lbrace;<br/>        return 'BSD</em>';<br/>    &rbrace; else if (WTFPL.test(str)) &lbrace;<br/>        return 'WTFPL<em>';<br/>    &rbrace; else if (APACHE.test(str)) &lbrace;<br/>        return 'Apache</em>';<br/>    &rbrace; else if (CC0_1_0.test(str)) &lbrace;<br/>        return 'CC0-1.0<em>';<br/>    &rbrace; else if(GPL.test(str)) &lbrace;<br/>        match = GPL.exec(str);<br/>        version = match[1];<br/>        /</em>istanbul ignore else<em>/<br/>        if(version.length === 1) &lbrace;<br/>            version = version + '.0';<br/>        &rbrace;<br/>        return 'GPL-'+version+'</em>';<br/>    &rbrace; else if(LGPL.test(str)) &lbrace;<br/>        match = LGPL.exec(str);<br/>        version = match[1];<br/>        if(version.length === 1) &lbrace;<br/>            version = version + '.0';<br/>        &rbrace;<br/>        return 'LGPL-'+version+'*';<br/>    &rbrace; else if(PUBLIC_DOMAIN.test(str)) &lbrace;<br/>        return 'Public Domain';<br/>    &rbrace; else &lbrace;<br/>        match = IS_URL.exec(str) || IS_FILE_REFERENCE.exec(str);<br/>        if(match) &lbrace;<br/>            return 'Custom: ' + match[1];<br/>        &rbrace; else &lbrace;<br/>            return null;<br/>        &rbrace;<br/>    &rbrace;<br/>&rbrace;;<br/></p>

