                           <p class="text-base sm:text-lg leading-relaxed break-words">var assert = require('assert'),<br/>    license = require('../lib/license');<br/><br/>describe('license parser', function() &lbrace;<br/><br/>    it('should export a function', function() &lbrace;<br/>        assert.equal(typeof license, 'function');<br/>    &rbrace;);<br/><br/>    it('undefined check', function() &lbrace;<br/>        assert.equal(license(undefined), 'Undefined');<br/>    &rbrace;);<br/><br/>    it('MIT check', function() &lbrace;<br/>        var data = license('asdf\nasdf\nasdf\nPermission is hereby granted, free of charge, to any');<br/>        assert.equal(data, 'MIT<em>');<br/>    &rbrace;);<br/><br/>    it('MIT word check', function() &lbrace;<br/>        var data = license('asdf\nasdf\nMIT\nasdf\n');<br/>        assert.equal(data, 'MIT</em>');<br/>    &rbrace;);<br/><br/>    it('Non-MIT word check', function() &lbrace;<br/>        var data = license('prefixMIT\n');<br/>        assert.notEqual(data, 'MIT<em>');<br/>    &rbrace;);<br/><br/>    it('GPL word check', function() &lbrace;<br/>        var data;<br/>        data = license('GNU GENERAL PUBLIC LICENSE \nVersion 1, February 1989');<br/>        assert.equal(data, 'GPL-1.0</em>');<br/>        data = license('GNU GENERAL PUBLIC LICENSE \nVersion 2, June 1991');<br/>        assert.equal(data, 'GPL-2.0<em>');<br/>        data = license('GNU GENERAL PUBLIC LICENSE \nVersion 3, 29 June 2007');<br/>        assert.equal(data, 'GPL-3.0</em>');<br/>    &rbrace;);<br/><br/>    it('Non-GPL word check', function() &lbrace;<br/>        var data;<br/>        data = license('preGNU GENERAL PUBLIC LICENSE \nVersion 1, February 1989');<br/>        assert.notEqual(data, 'GPL-1.0<em>');<br/>        data = license('preGNU GENERAL PUBLIC LICENSE \nVersion 2, June 1991');<br/>        assert.notEqual(data, 'GPL-2.0</em>');<br/>        data = license('preGNU GENERAL PUBLIC LICENSE \nVersion 3, 29 June 2007');<br/>        assert.notEqual(data, 'GPL-3.0<em>');<br/>    &rbrace;);<br/><br/>    it('LGPL word check', function() &lbrace;<br/>        var data;<br/>        data = license('GNU LIBRARY GENERAL PUBLIC LICENSE\nVersion 2, June 1991');<br/>        assert.equal(data, 'LGPL-2.0</em>');<br/>        data = license('GNU LESSER GENERAL PUBLIC LICENSE\nVersion 2.1, February 1999');<br/>        assert.equal(data, 'LGPL-2.1<em>');<br/>        data = license('GNU LESSER GENERAL PUBLIC LICENSE \nVersion 3, 29 June 2007');<br/>        assert.equal(data, 'LGPL-3.0</em>');<br/>    &rbrace;);<br/><br/>    it('BSD check', function() &lbrace;<br/>        var data = license('asdf\nRedistribution and use in source and binary forms, with or without\nasdf\n');<br/>        assert.equal(data, 'BSD<em>');<br/>    &rbrace;);<br/><br/>    it('BSD-Source-Code check', function() &lbrace;<br/>        var data = license('asdf\nRedistribution and use of this software in source and binary forms, with or without modification, are permitted provided that the following conditions are met:\nasdf\n');<br/>        assert.equal(data, 'BSD-Source-Code</em>');<br/>    &rbrace;);<br/><br/>    it('BSD word check', function() &lbrace;<br/>        var data = license('asdf\nasdf\nBSD\nasdf\n');<br/>        assert.equal(data, 'BSD<em>');<br/>    &rbrace;);<br/>    <br/>    it('Non-BSD word check', function() &lbrace;<br/>        var data = license('prefixBSD\n');<br/>        assert.notEqual(data, 'BSD</em>');<br/>    &rbrace;);<br/><br/>    it('Apache word check', function() &lbrace;<br/>        var data = license('asdf\nasdf\nApache License\nasdf\n');<br/>        assert.equal(data, 'Apache<em>');<br/>    &rbrace;);<br/>    <br/>    it('Non-Apache word check', function() &lbrace;<br/>        var data = license('prefixApache License\n');<br/>        assert.notEqual(data, 'Apache</em>');<br/>    &rbrace;);<br/><br/>    it('WTF check', function() &lbrace;<br/>        var data = license('DO WHAT THE FUCK YOU WANT TO PUBLIC LICENSE');<br/>        assert.equal(data, 'WTFPL<em>');<br/>    &rbrace;);<br/><br/>    it('WTF word check', function() &lbrace;<br/>        var data = license('asdf\nasdf\nWTFPL\nasdf\n');<br/>        assert.equal(data, 'WTFPL</em>');<br/>    &rbrace;);<br/>    <br/>    it('Non-WTF word check', function() &lbrace;<br/>        var data = license('prefixWTFPL\n');<br/>        assert.notEqual(data, 'WTFPL<em>');<br/>    &rbrace;);<br/><br/>    it('ISC check', function() &lbrace;<br/>        var data = license('asdfasdf\nThe ISC License\nasdfasdf');<br/>        assert.equal(data, 'ISC</em>');<br/>    &rbrace;);<br/><br/>    it('Non-ISC word check', function() &lbrace;<br/>        var data = license('prefixISC\n');<br/>        assert.notEqual(data, 'ISC<em>');<br/>    &rbrace;);<br/><br/>    it('ISC word check', function() &lbrace;<br/>        var data = license('asdf\nasdf\nISC\nasdf\n');<br/>        assert.equal(data, 'ISC</em>');<br/>    &rbrace;);<br/><br/>    it('CC0-1.0 word check', function() &lbrace;<br/>        var data = license('The person who associated a work with this deed has dedicated the work to the public domain by waiving all of his or her rights to the work worldwide under copyright law, including all related and neighboring rights, to the extent allowed by law.\n\nYou can copy, modify, distribute and perform the work, even for commercial purposes, all without asking permission.\n');<br/>        assert.equal(data, 'CC0-1.0*');<br/>    &rbrace;);<br/><br/>    it('Public Domain check', function() &lbrace;<br/>        var data = license('Public Domain');<br/>        assert.equal(data, 'Public Domain');<br/>        data = license('public domain');<br/>        assert.equal(data, 'Public Domain');<br/>        data = license('Public domain');<br/>        assert.equal(data, 'Public Domain');<br/>    &rbrace;);<br/><br/>    it('License at URL check', function() &lbrace;<br/>        var data = license('http://example.com/foo');<br/>        assert.equal(data, 'Custom: http://example.com/foo');<br/>        data = license('See license at http://example.com/foo');<br/>        assert.equal(data, 'Custom: http://example.com/foo');<br/>        data = license('https://example.com/foo');<br/>        assert.equal(data, 'Custom: https://example.com/foo');<br/>    &rbrace;);<br/><br/>    it('License at file check', function() &lbrace;<br/>        var data = license('See license in LICENSE.md');<br/>        assert.equal(data, 'Custom: LICENSE.md');<br/>        data = license('SEE LICENSE IN LICENSE.md');<br/>        assert.equal(data, 'Custom: LICENSE.md');<br/>    &rbrace;);<br/><br/><br/>    it('Check for null', function() &lbrace;<br/>        var data = license('this is empty, hi');<br/>        assert.equal(data, null);<br/>    &rbrace;);<br/><br/>    describe('SPDX licenses', function() &lbrace;<br/><br/>        it('should parse a basic SPDX license', function() &lbrace;<br/>            var data = [<br/>                'MIT',<br/>                'LGPL-2.0',<br/>                'Apache-2.0',<br/>                'BSD-2-Clause'<br/>            ];<br/>            data.forEach(function(licenseType) &lbrace;<br/>                assert.equal(license(licenseType), licenseType);<br/>            &rbrace;);<br/>        &rbrace;);<br/><br/>        it('should parse more complicated license expressions', function() &lbrace;<br/>            var data = [<br/>                '(GPL-2.0+ WITH Bison-exception-2.2)',<br/>                'LGPL-2.0 OR (ISC AND BSD-3-Clause+)',<br/>                'Apache-2.0 OR ISC OR MIT',<br/>            ];<br/>            data.forEach(function(licenseType) &lbrace;<br/>                assert.equal(license(licenseType), licenseType);<br/>            &rbrace;);<br/><br/>        &rbrace;);<br/><br/>    &rbrace;);<br/>&rbrace;);<br/></p>

