                           @npmcli\arborist\bin
                           </summary>
                           <div class="h-4">
                           </div>
                           <p class="text-base sm:text-lg leading-relaxed break-words">const localeCompare = require('@isaacs/string-locale-compare')('en')<br/>const Arborist = require('../')<br/>const log = require('./lib/logging.js')<br/><br/>module.exports = (options, time) =&gt; &lbrace;<br/>  const query = options._.shift()<br/>  const a = new Arborist(options)<br/>  return a<br/>    .loadVirtual()<br/>    .then(tree =&gt; &lbrace;<br/>      // only load the actual tree if the virtual one doesn't have modern metadata<br/>      if (!tree.meta || !(tree.meta.originalLockfileVersion &gt;= 2)) &lbrace;<br/>        throw 'load actual'<br/>      &rbrace; else &lbrace;<br/>        return tree<br/>      &rbrace;<br/>    &rbrace;).catch((er) =&gt; &lbrace;<br/>      log.error('loading actual tree', er)<br/>      return a.loadActual()<br/>    &rbrace;)<br/>    .then(time)<br/>    .then((&lbrace; result: tree &rbrace;) =&gt; &lbrace;<br/>      const output = []<br/>      if (!query) &lbrace;<br/>        const set = []<br/>        for (const license of tree.inventory.query('license')) &lbrace;<br/>          set.push([tree.inventory.query('license', license).size, license])<br/>        &rbrace;<br/><br/>        for (const [count, license] of set.sort((a, b) =&gt;<br/>          a[1] &amp;&amp; b[1] ? b[0] - a[0] || localeCompare(a[1], b[1])<br/>          : a[1] ? -1<br/>          : b[1] ? 1<br/>          : 0)) &lbrace;<br/>          output.push(<code>$&amp;lbrace;count&amp;rbrace; $&amp;lbrace;license&amp;rbrace;</code>)<br/>          log.info(count, license)<br/>        &rbrace;<br/>      &rbrace; else &lbrace;<br/>        for (const node of tree.inventory.query('license', query === 'undefined' ? undefined : query)) &lbrace;<br/>          const msg = <code>$&amp;lbrace;node.name&amp;rbrace; $&amp;lbrace;node.location&amp;rbrace; $&amp;lbrace;node.package.description || ''&amp;rbrace;</code><br/>          output.push(msg)<br/>          log.info(msg)<br/>        &rbrace;<br/>      &rbrace;<br/><br/>      return output.join('\n')<br/>    &rbrace;)<br/>&rbrace;<br/></p>

